(82, 4, '无上神帝', 'Supreme God Emperor', 'wushangshendi', 'wushangshendi', 'https://banana.xpornkit.com/upload/covers/2025/12/29/3c6e9f96b9b35c191177dec24e326c3f.jpg', '', '溪林,忻子约,关帅,冷泉夜月,季骜杰,钟巍,烈之流星,蘭雨馨,张妮,徐翔,Akira明,柳知萧', '项方', '', '2020', '中国大陆', '汉语普通话', 0.0, 0, 0, 0, 0, 0, 0, '第556集', '万年之前，仙王牧云因持有诛仙图而遭人暗算，残魂沉睡万年之后，在天运大陆南云帝国有名的“废物牧云”身上觉醒。牧云初醒，就受到了学生妙仙语的刻意刁难，牧云轻松的就化解了妙仙语的陷阱，并举一反三的说出了更多的炼丹技巧，让门外的炼丹大师莫问赏识不已。回到家中，牧云得知了要与秦家小姐秦梦瑶结亲的消息。秦梦瑶寒毒在身，活不过二十岁，结亲不过是为了牧家和秦家的利益。但牧林辰的劝说下，牧云以炼丹为条件，答应了这门亲事。炼出了淬骨丹，牧云的修为有了第一次提升。莫问时常来找牧云请教，而秦时雨一直想请莫问来治疗孙女秦梦瑶。莫问暗示让牧云一试，牧云阴差阳错下唤醒了体内的诛仙图，得知秦梦瑶体内的并非寒毒，而是冰凰神魄。牧云治好了秦梦瑶，冰凰神魄的力量使得秦梦瑶修为突飞猛进。在见识到了牧云的能力后，秦梦瑶对牧云充满了好奇和兴趣，于是成为了北云学院的导师，和牧云教导同一个班级。而追求秦梦瑶不成的东方玉，嫉妒仇恨之心燃起，誓与牧云势不两立。 牧云借着诛仙图突破修为，去北云山脉历练，妙仙语执意同行，途中牧云以一人之力猎杀十几头紫毛猎狼，让妙仙语十分震惊。而被人指派暗杀幕运动柳山四煞一路尾随，趁牧云脱力之机会，纷纷现身准备对牧云下手。', 'hnyun$$$hnm3u8', '第01集$https://hn.bfvvs.com/play/YerKQQ2a#第02集$https://hn.bfvvs.com/play/penL2lb7#第03集$https://hn.bfvvs.com/play/YerPj6bO#第04集$https://hn.bfvvs.com/play/penL24b7#第05集$https://hn.bfvvs.com/play/PdyZqVeQ#第06集$https://hn.bfvvs.com/play/1aKPPrbQ#第07集$https://hn.bfvvs.com/play/5eV445bE#第08集$https://hn.bfvvs.com/play/Rb4ll2bB#第09集$https://hn.bfvvs.com/play/lejEEWdj#第10集$https://hn.bfvvs.com/play/penLL4b7#第11集$https://hn.bfvvs.com/play/PdyZZVeQ#第12集$https://hn.bfvvs.com/play/1aKP0rbQ#第13集$https://hn.bfvvs.com/play/5eV4Y5bE#第14集$https://hn.bfvvs.com/play/QeZk3vap#第15集$https://hn.bfvvs.com/play/yb8pklbv#第16集$https://hn.bfvvs.com/play/penLB4b7#第17集$https://hn.bfvvs.com/play/YerPJwbO#第18集$https://hn.bfvvs.com/play/penLBDb7#第19集$https://hn.bfvvs.com/play/YerPKkbO#第20集$https://hn.bfvvs.com/play/DbDGBYal#第21集$https://hn.bfvvs.com/play/1aKPMzbQ#第22集$https://hn.bfvvs.com/play/5eV419bE#第23集$https://hn.bfvvs.com/play/QeZk5Eap#第24集$https://hn.bfvvs.com/play/yb8pm5bv#第25集$https://hn.bfvvs.com/play/penLDDb7#第26集$https://hn.bfvvs.com/play/YerPQkbO#第27集$https://hn.bfvvs.com/play/DbDGMYal#第28集$https://hn.bfvvs.com/play/1aKPWzbQ#第29集$https://hn.bfvvs.com/play/5eV489bE#第30集$https://hn.bfvvs.