(83, 10, '鱼缸', 'The Fish Tank', 'yugang', 'yugang', 'https://banana.xpornkit.com/upload/covers/2025/12/29/ea605c4dd7cc1f6bff975a90e5ab53fb.jpg', '', '凯蒂·贾维斯,迈克尔·法斯宾德,凯利斯顿·韦勒英,Rebecca,Griffiths,哈里·崔德威', '安德里亚·阿诺德', '', '2009', '英国 / 荷兰', '英语', 7.5, 0, 0, 0, 0, 0, 0, '正片', '　　15岁的米娅（凯蒂·贾维斯 Katie Jarvis 饰）性格叛逆而古怪，惹事生非的她不仅被学校开除而且连她最好的朋友都离她而去。米娅热爱跳舞，然而身边却似乎并没有多少人在意她那充满热情的舞步，直到一个叫康纳（迈克尔·法斯宾德 Michael         Fassbender 饰）的男人出现。康纳是母亲的男朋友，在他与母亲同居的日子里，米娅被这个英俊而又友善的男人所吸引。在康纳的支持和鼓励下，米娅得到了一次舞蹈面试的机会，而且与康纳的关系也更进了一步。然而，现实世界并非想像的那样的美好……                                                                    　　本片由在2006年凭借《红色之路》获得戛纳电影节评委会奖的英国新锐女导演安德里亚·阿诺德（Andrea Arnold）执导，是她的第二部电影长片。作为2009年戛纳电影节竞赛影片，《鱼缸》在2009年英国独立电影节获得8项提名。', 'hnyun$$$hnm3u8', '正片$https://hn.bfvvs.com/play/en55GDRd$$$正片$https://hn.bfvvs.com/play/en55GDRd/index.m3u8', '', NULL, 1, 1766995798, 1766995798),
