(257, 4, '名侦探柯南', 'Detective Conan / Meitantei Conan / Case Closed', 'mingzhentankenan', 'mingzhentankenan', 'https://banana.xpornkit.com/upload/covers/2025/12/29/699ecc2d767b03e95713355a2c537990.jpg', '', '高山南,山崎和佳奈,神谷明,小山力也,林原惠美,山口胜平,田中秀幸,岛本须美,绪方贤一,堀川亮,松井菜樱子,宫村优子,岩居由希子,大谷育江,高木涉,高岛雅罗,堀之纪,立木文彦,小山茉美,三石琴乃,置鲇龙太郎,日高法子,池田秀一,古谷彻', '儿玉兼嗣,山本泰一郎,佐藤真人,于地纮仁', '', '1996', '日本', '日语 / 英语 / ', 0.0, 0, 0, 0, 0, 0, 0, '第1244集', '在美国曼哈顿举行的艺术品拍卖会上，一度被认为毁于二战空袭的梵高亲笔临摹向日葵系列2号画作惊艳登场。财大气粗的铃木财团顾问的铃木次郎吉（富田耕生 配音）一骑绝尘，以三亿美元天价将其收入囊中。在之后的记者招待会上，铃木宣布将联系分散在世界各地收藏家手中的向日葵画作集结在日本，举行一次梦幻展览。为此，他聘请毛利小五郎（小山力也 配音）、展览企划负责人圭子•安德森（榊原良子 配音）、画作鉴定师宫台夏美（荣仓奈奈 配音）等七位专家组成“七武士”团队为展览保驾护航。谁知怪盗基德（山口胜平 配音）从一开始便锁定该画作，他不仅大闹会场，还为了抢夺画作而险些炸毁运送专机。 随着画展日期的临近，柯南（高山南 配音）与伙伴们必须尽快越过一座座难以想象的险峰……', 'hnyun$$$hnm3u8', '第1集$https://hn.bfvvs.com/play/yb83jkLa#第2集$https://hn.bfvvs.com/play/lejYzxld#第3集$https://hn.bfvvs.com/play/penREBEe#第4集$https://hn.bfvvs.com/play/Yer2LJKe#第5集$https://hn.bfvvs.com/play/PdywVRPa#第6集$https://hn.bfvvs.com/play/DbDqyBqd#第7集$https://hn.bfvvs.com/play/1aK8JMYb#第8集$https://hn.bfvvs.com/play/YaOgNQLa#第9集$https://hn.bfvvs.com/play/5eVvX1We#第10集$https://hn.bfvvs.com/play/QeZ825Rb#第11集$https://hn.bfvvs.com/play/Rb461gne#第12集$https://hn.bfvvs.com/play/yb83jmLa#第13集$https://hn.bfvvs.com/play/lejYzyld#第14集$https://hn.bfvvs.com/play/penREDEe#第15集$https://hn.bfvvs.com/play/Yer2LKKe#第16集$https://hn.bfvvs.com/play/lejYzGRd#第17集$https://hn.bfvvs.com/play/penREMRe#第18集$https://hn.bfvvs.com/play/Yer2LQEe#第19集$https://hn.bfvvs.com/play/PdywV17a#第20集$https://hn.bfvvs.com/play/DbDqyMxd#第21集$https://hn.bfvvs.com/play/1aK8JWRb#第22集$https://hn.bfvvs.com/play/YaOgN1pa#第23集$https://hn.bfvvs.com/play/5eVvX8Me#第24集$https://hn.bfvvs.com/play/QeZ82lJb#第25集$https://hn.bfvvs.com/play/Rb461p1e#第26集$https://hn.bfvvs.com/play/yb83jwma#第27集$https://hn.bfvvs.com/play/lejYz7Rd#第28集$https://hn.bfvvs.com/play/penREnRe#第29集$https://hn.bfvvs.com/play/Yer2LyEe#第30集$https://hn.bfvvs.com/play/PdywVQ7a#第31集$https://hn.bfvvs.com/play/DbDqypxd#第32集$ht