(276, 9, '追远寻根', '血源(港)', 'zhuiyuanxungen', 'zhuiyuanxungen', 'https://banana.xpornkit.com/upload/covers/2025/12/29/106c4fec2bb70a7d2fac33fa37af4799.jpg', '', 'Clare,Monnelly,布里·尼·内奇廷,亚历山德拉·比斯特日茨卡娅,Clare,Barrett,夏洛特·布拉德利,塔拉·布雷思纳克,格蕾丝·科伦德,Peadar,Cox,Jim,Cunningham,多萝西·达菲,Marcus,Lamb,迈克尔·奥·莱恩,Oisín,Ó,Maoileoin,Liv,O\'Donoghue,奥尔加·韦尔利', '艾丝琳·克拉克', '', '2024', '爱尔兰', '英语 / 爱尔兰语', 0.0, 0, 0, 0, 0, 0, 0, '正片', '被誉为“史上第一部爱尔兰语恐怖片”，《弗雷瓦卡》围绕一位名叫休的护理工作者展开，她被个人悲剧所困扰。休被派往一个偏远村庄照顾一位患有广场恐惧症的女性，她既害怕邻居，也害怕纳希德——她相信几十年前被这些神秘民间实体绑架。随着两人建立起深厚的联系，休逐渐被这位老妇人的偏执、仪式和迷信所吞噬，最终面对她自己的过去所带来的恐怖。', 'hnyun$$$hnm3u8', '正片$https://hn.bfvvs.com/play/eVOO5X1a$$$正片$https://hn.bfvvs.com/play/eVOO5X1a/index.m3u8', '', NULL, 1, 1766995875, 1766995875),
